import'../styles/post.scss'
import {ProfileStory} from "./storytop"
import {postDatas} from "../data"

function Post(){
    return(
        <div className='posts'>
            {
                postDatas.map((data, index)=>(
                    <div className="post" key={index}>
                        <div className="top">
                            <ProfileStory  img={data.profile} size={"50"}/>
                            <h6>{data.name}</h6>
                            <p><span>.</span>{data.postDate}</p>
                            <img src="" alt="" />
                        </div>
                    </div>
                ))
            }
        </div>



    )
}
export default Post;
